import React, { useState } from "react";
import { Bar } from "recharts";
import { FiUsers, FiLogOut } from "react-icons/fi";
import { FaTachometerAlt } from "react-icons/fa";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Dashboard = () => {
  const [activePage, setActivePage] = useState("dashboard");

  return (
    <div className="d-flex vh-100">
      {/* Sidebar */}
      <div className="bg-dark text-white p-3" style={{ width: "250px" }}>
        <h3 className="text-center">Admin Panel</h3>
        <ul className="nav flex-column">
          <li className="nav-item">
            <button
              className={`btn w-100 text-start ${activePage === "dashboard" && "btn-primary"}`}
              onClick={() => setActivePage("dashboard")}
            >
              <FaTachometerAlt /> Dashboard
            </button>
          </li>
          <li className="nav-item mt-2">
            <button
              className={`btn w-100 text-start ${activePage === "users" && "btn-primary"}`}
              onClick={() => setActivePage("users")}
            >
              <FiUsers /> Users
            </button>
          </li>
          <li className="nav-item mt-2">
            <Link to="/logout" className="btn btn-danger w-100 text-start">
              <FiLogOut /> Logout
            </Link>
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="flex-grow-1 p-4">
        {activePage === "dashboard" ? <DashboardContent /> : <UsersContent />}
      </div>
    </div>
  );
};

// Dashboard Page Content
const DashboardContent = () => {
  return (
    <div>
      <h2>Dashboard Overview</h2>
      <p>Welcome to the admin dashboard!</p>
    </div>
  );
};

// Users Page Content
const UsersContent = () => {
  return (
    <div>
      <h2>Users Management</h2>
      <p>Manage users from here.</p>
    </div>
  );
};

export default Dashboard;
